import React from 'react'
import logo from '../pic/logo.png'
import 'tachyons'

const trainee_header = () => {
  return (
    <div>
        <header class='bg-white black-80 tc avenir'>
            <img src={logo} alt='' className='h3'/>

        </header>
    </div>
  )
}

export default trainee_header
